import React, { useEffect, useState } from 'react';
import {Caja} from'react-chartjs-2';
import {db} from '../../firebase'

import Usaquen from "../../Utils/Img/Cajas/sumapaz.png";
import Chapinero from "../../Utils/Img/Cajas/ciudad-bolivar.png";
import Santafe from "../../Utils/Img/Cajas/candelaria.png";
import Sancristobal from "../../Utils/Img/Cajas/antonio.png";
import Usme from "../../Utils/Img/Cajas/teusaquillo.png";
import Tunjuelito from "../../Utils/Img/Cajas/tunjuelito.png";
import Bosa from "../../Utils/Img/Cajas/bosa.png";
import Kenedi from "../../Utils/Img/Cajas/kennedy.png";
import Fontibon from "../../Utils/Img/Cajas/fontibón.png";
import Engativa from "../../Utils/Img/Cajas/ciudad-bolivar.png";
import Suba from "../../Utils/Img/Cajas/candelaria.png";
import Barriosunidos from "../../Utils/Img/Cajas/usme.png";
import Teusaquillo from "../../Utils/Img/Cajas/teusaquillo.png";
import Martires from "../../Utils/Img/Cajas/martires.png";
import Antonionariño from "../../Utils/Img/Cajas/antonio.png";
import Puentearanda from "../../Utils/Img/Cajas/usme.png";
import Candelaria from "../../Utils/Img/Cajas/candelaria.png";
import Uribe from "../../Utils/Img/Cajas/rafael.png";
import Cbolivar from "../../Utils/Img/Cajas/ciudad-bolivar.png";
